    f = max(n.cost for n in graph.nodes)
    heap = [(f - start.cost, start, [])]
    while heap:
        c, n, p = heappop(heap)
        if n == stop:
            return (f + f * len(p) - c, list(reversed([(x.i, x.j) for x in p])))
        for m in graph.edges[n]:
            heappush(heap, (f - m.cost + c, m, [n] + p))

